import React, { Component } from 'react';
import {  Route,  Switch } from "react-router-dom";
import Login from '../Login/Login.js';
import Signup from '../Signup/Signup.js';
import Home from '../Home/Home.js';
import Help from '../Help/Help.js';
import New from '../New/New.js';
import About from '../About/About.js';
import Contact from '../Contact/Contact.js';
import Search from '../Search/Search.js';
import Detail from '../Product_Detail/Detail.js';
import CartContainer from '../Cart/CartContainer.js';
import Complete from '../Cart/Complete.js';
import Profile from '../Profile/Profile.js';
import Recent from '../Recent/Recent.js';
import Orderhistory from '../OrderHistory/Orderhistory.js';
import Detailoforder from '../OrderHistory/Detailoforder.js';
import ResultMenu from '../Menu/ResultMenu.js';
import ResultFilter from '../Menu/ResultFilter.js';
import Dashboard from '../Admin/Dashboard.js';
import ManagerUser from '../Admin/ManagerUser.js';
import AddProduct from '../Admin/AddProduct.js';
import AddUser from '../Admin/AddUser.js';
import User from '../Admin/User.js';
import ManagerOrder from '../Admin/ManagerOrder.js';
class RouterURL extends Component {
    render() {
        return (
            <div>
                <Switch>

                    <Route exact path="/login" component={Login}/>
                    <Route exact path="/signup" component={Signup}/>
                    <Route exact path="/home" component={Home} />
                    <Route exact path="/help" component={Help}/>
                    <Route exact path="/contact" component={Contact}/>
                    <Route exact path="/new" component={New}/>
                    <Route exact path="/about" component={About}/>
                    <Route exact path="/search" component={Search}/>
                    <Route exact path="/product_detail" component={Detail}/>
                    <Route exact path="/cart" component={CartContainer} />
                    <Route exact path="/order" component={Complete} />
                    <Route exact path="/profile" component={Profile} />
                    <Route exact path="/recent" component={Recent} />
                    <Route exact path="/order_history" component={Orderhistory}/>
                    <Route exact path="/order_detail" component={Detailoforder}/>
                    <Route exact path="/category" component={ResultMenu}/>
                    <Route exact path="/filter" component={ResultFilter}/>
                    <Route exact path="/admin" component={Dashboard}/>
                    <Route exact path="/users" component={ManagerUser}/>
                    <Route exact path="/newuser" component={AddUser}/>
                    <Route exact path="/newproduct" component={AddProduct}/>
                    <Route exact path="/user" component={User}/>
                    <Route exact path="/orders" component={ManagerOrder}/>

                    <Route component={Home}/>
                </Switch>
            </div>
        );
    }
}

export default RouterURL;
